import React, { Component } from 'react';


class Nav extends Component{
    render(){
        return(
            <div className='marco container'>
                <h1>Hola</h1>
                <style jsx>
                    {`
                        .marco{
                            border-style: dotted;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default Nav;
